import "./popular_slide.css"
import { useSelector } from "react-redux";

const PopularSlide = () => {

    const movies = useSelector(state => state.movies)
    state = {
        items: [
          {id: 1, title: 'item #1'},
          {id: 2, title: 'item #2'},
          {id: 3, title: 'item #3'},
          {id: 4, title: 'item #4'},
          {id: 5, title: 'item #5'}
        ]
      }
    return (
        <div className="body_popular">

        </div>

    )
}

export default PopularSlide;
